import React, { Component } from "react";
import Location from "./Location";

class Education extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <ul>
          {this.props.education.map((school) => {
            return(<li>

        <div>
          {school.institution}{" "}
          {school.graduationDate}
        </div>

        <div>
          {school.description}

          <Location
            city={school.city}
            state={school.state}
          />

        </div>
            </li>);
          })}
        </ul>
      </div>
    );
  }
}

export default Education;
